import './App.css';
import { Button } from 'react-bootstrap';
import { Card } from 'react-bootstrap';

function App(props) {
  return (
    <div className="container-fluid m-auto d-inline">
                <Card style={{ width: '18rem' }}>
                  <Card.Img variant="top" src="aa.jpg" alt="image..."/>
                  <Card.Body>
                    <Card.Title>Card Title</Card.Title>
                    <Button className="form-class" variant="primary">Add to Cart</Button>
                  </Card.Body>
                </Card>
  </div>
  );
}

export default App;
